let findAssociationRules = function (frequentItemSet, minConf) {
    console.important('Finding Association Rules !');
    console.log('   minConf :', minConf);
    let associationRules = [];
    let rhs = lhs = null;
    let supprhs = supplhs = 0;
    console.important('----------------------');

    console.time('Exec time');

    frequentItemSet.forEach(itemSet => {
        rhs = null;
        lhs = createCombinations(itemSet.itemSet, 1, itemSet.itemSet.length);
        lhs.forEach(element => {
            rhs = itemSet.itemSet.filter(e => (element.indexOf(e) == -1));
            console.log('lhs :', element);
            console.log('rhs :', rhs);
            console.log('---');
            associationRules.push(new AssociationRule(element, rhs, null));
        });
    });

    associationRules.forEach(associationRule => {
        let i = 0;
        while (!sameItemSet(associationRule.lhs, frequentItemSet[i].itemSet)) {
            i++
        }
        supplhs = frequentItemSet[i].support;

        i = 0;
        while (!sameItemSet(associationRule.rhs, frequentItemSet[i].itemSet)) {
            i++
        }
        supprhs = frequentItemSet[i].support;

        associationRule.confidence = supplhs / supprhs;
    });

    associationRules = associationRules.filter(e => e.confidence >= minConf);

    console.log('Association Rules :');
    console.table(associationRules);

    require('fs').writeFile('associationRules.js', JSON.stringify(associationRules), 'utf8', (err) => {
        if (err) throw err;
        console.log('Association Rules Saved!');
    });

    console.timeEnd('Exec time');
    return associationRules;
}

